// ===========================
// Import React
// ===========================
import React from "react";

// ===========================
// Import chef images (real filenames)
// ===========================
import Chef1 from "../assets/chef1.png"; // Marcus (swapped)
import Chef2 from "../assets/chef2.png"; // Maria (swapped)
import Chef3 from "../assets/chef3.png"; // Luis
import Chef4 from "../assets/chef4.png"; // Ana

// ===========================
// ChefGrid component
// ===========================
export default function ChefGrid() {
  return (
    <section className="chef-grid container">
      {/* Grid heading */}
      <h2>Meet Our Chefs</h2>

      {/* Chef cards */}
      <div className="grid">
        {/* Maria */}
        <div className="chef-card">
          <img src={Chef2} alt="Maria" />
          <h3>Maria</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>

        {/* Marcus */}
        <div className="chef-card">
          <img src={Chef1} alt="Marcus" />
          <h3>Marcus</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>

        {/* Luis */}
        <div className="chef-card">
          <img src={Chef3} alt="Luis" />
          <h3>Luis</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>

        {/* Ana */}
        <div className="chef-card">
          <img src={Chef4} alt="Ana" />
          <h3>Ana</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>
      </div>
    </section>
  );
}
